export function fetchCustomerIdByEmail(email:string){
  return fetch('http://localhost:8080/login', {
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      email: email,
    }),
    mode: 'cors',
    method: 'GET',
  })
    .then((data) => data.text())
    .then((data) => {
      return data;
    })
    .catch((error) => console.log(error));
}
